import React from 'react';
import ImageUpload from './components/ImageUpload'
import DisplayColors from './DisplayColors'
import DisplayFeatureImage from './DisplayFeatureImage'
import MatchedImages from './MatchedImages'
// import './App.css';

function App() {
  return (
    <div className="App">
     < ImageUpload />
      < DisplayColors />
      < DisplayFeatureImage />
      < MatchedImages />
    </div>
  );
}

export default App;
